import axios from "axios";

const apikey = "182029e5fd8857afe1cdfc171d45cf1d"

export const api = axios.create({
    baseURL: ` https://api.flickr.com/services/rest/?method=flickr.photos.search&api_key=${apikey}&tags=`
});
